import React, { Component } from 'react';
import LottoBall from './LottoBall';

class Lottery extends Component {
  render() {
    return (
      <div>
        <h1>{this.props.title}</h1>
        <LottoBall ball="1" />
        <LottoBall ball="2" />
        <LottoBall ball="3" />
        <LottoBall ball="4" />
        <LottoBall ball="5" />
        <LottoBall ball="6" />
        <button>Generate</button>
      </div>
    )
  }
}

export default Lottery;
